                temp = _09d;
            else if (iconID == "10d")
                temp = _10d;
            else if (iconID == "11d")
                temp = _11d;
            else if (iconID == "13d")
                temp = _13d;
            else if (iconID == "50d")
                temp = _50d;
            else if (iconID == "01n")
                temp = _01n;
            else if (iconID == "02n")
                temp = _02n;
            else if (iconID == "10n")
                temp = _10n;
            else
                temp = unknown;

            lcd.WriteBitmap(2, 31, 32, 32, temp);
            lcd.WriteText(LCDFont.Dimensions_5x8, 40, 42, descript);

            //Extra info box
            lcd.WriteText(LCDFont.Dimensions_5x8, 50, 11, "Humidity: " + humidity + "%");
            lcd.WriteText(LCDFont.Dimensions_5x8, 50, 20, "Wind: " + windspeed + "km/h");
        }
        static void redraw(LCD lcd)
        {
            lcd.Clear();
            //draw borders around outside
            lcd.DrawLine(0, 0, 127, 0);
            lcd.DrawLine(0, 0, 0, 63);
            lcd.DrawLine(127, 0, 127, 63);
            lcd.DrawLine(0, 63, 127, 63);

            //draw borders inside
            lcd.DrawLine(0, 10, 128, 10);
            lcd.DrawLine(43, 10, 43, 30);
            lcd.DrawLine(1, 30, 127, 30);
            lcd.WriteText(LCDFont.Dimensions_5x8, 1, 1, DateTime.Now.ToString(" ddd, MMM d hh:mm:ss tt"));
            updateWeather(lcd);
            lcd.Flush();
        }

        static void Main(string[] args)
        {
            int count = 0;
            LCD lcd = new LCD();
            lcd.Open(2000);
            lcd.Contrast = 0.25;
            lcd.Backlight = 0.8;

            //LCD Screen
            //create bitmap for degree symbol
            lcd.SetFontSize(LCDFont.User1, 6, 12);
            lcd.SetCharacterBitmap(LCDFont.User1, "0", degrees);

            redraw(lcd);

            while (true)
            {
                if (count == 900)//900 seconds = 15 minutes
                {
                    count = 0;
                    redraw(lcd);
                }
                else
                {
                    //Date & time with underline
                    lcd.WriteText(LCDFont.Dimensions_5x8, 1, 1, DateTime.Now.ToString(" ddd, MMM d hh:mm:ss tt"));
                    lcd.Flush();
                }

                count += 1;
                Thread.Sleep(1000);
            }
        }
    }
}
